            <img 
            src={postImage} 
            alt="" 
            className="singlePostImg" 
            />
            <h1 className="singlePostTitle">
                Lorem ipsum, dolor sit amet consectetur adipisicing elit.
            </h1>
        </div>
    </div>
  )
}

export default SinglePost
